import "./App.css";
import Home from "./Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <div>
        <Router>
          <Routes>
            <Route exact path="/" element={ <Home />}/>
          </Routes>
        </Router>
    </div>
  );
}

export default App;
